window.bookSummaryJSON = "<p><b>Harry Dresden is back and ready for action, in the new entry in the number-one </b><b><i>New York Times</i></b><b> best-selling Dresden Files.</b>&nbsp;</p> <p>When the supernatural nations of the world meet up to negotiate an end to ongoing hostilities, Harry Dresden, Chicago's only professional wizard, joins the White Council's security team to make sure the talks stay civil. But can he succeed, when dark political manipulations threaten the very existence of Chicago - and all he holds dear?</p>"; 
